import React from "react";
import "./App.css";
import { Signin, Signup } from './pages/';

function App() {
  return (
    <div className="App">
      <Signin />
      <Signup />
      <Route exact path="/" component={Signin}/>
      <Route path="/about" component={Signup}/>
    </div>
  );
}

export default App;
